import React from 'react';
import Freelancer from '../containers/Freelancer.js';
import PropTypes from 'prop-types';

class FreelancerList extends React.Component {
  render() {
    return (
      <div>
        {
          this.props.freelancers.map(freelancer => (
            <Freelancer
              key={freelancer.id}
              freelancer={freelancer.name} />
          ))
        }
      </div>
    );
  }
}

FreelancerList.propTypes = {
  freelancers: PropTypes.arrayOf(PropTypes.object).isRequired
};

FreelancerList.defaultProps = {
  freelancers: []
};

export default FreelancerList;
